        etsystem_2:
          'Easy trading(ET system)，Why create a documentary system\nWhy is it difficult for ordinary investors to participate in transactions? Because the transaction process is actually very complicated, including different product choices, trading strategies, capital proportions, and so on. For ordinary investors, the transaction interface is also very difficult, and the key data is dazzled, making it difficult to master.\nWe hope to provide a more friendly and simple investment environment for global trading investors, so we have created a "documentary system". In the documentary system, you can freely choose your favorite signal source. The source of the signal source may be other platform investors, or you can choose the AI ​​smart investment portfolio provided by our platform. After selecting the signal source and setting the transaction ratio parameters, you can easily achieve the investment performance of one-click trading and easy profitability.\n\nThe benefits of being a signal source\nThe platform uses the latest community trading features to establish a plan, where outstanding traders can receive rewards while sharing their investment knowledge. The advantage of online investment is not just to access different trading markets. The community function provides new daily trading elements and tools-including a new model for earning revenue.\n\nAn extremely attractive option for the Copy Signal Source program is that the program rewards outstanding traders for allowing others to automatically copy their positions. If traders attract users through the platform\'s copy trading system function, they can choose to create a tracking list and receive special rewards. The accumulated amount of these special rewards each month can be considerable.\n\nHow to use the documentary system\nThe documentary system is one of the functions of our platform to become a leader in financial technology innovation. The overall thinking of the order copying system is very simple: select the signal source you want to copy, determine the amount you want to invest, and just click a button to automatically copy all trading activities of the order signal source in real time:\n\nCopy trading rules:\n\nThe operation of the platform is completely transparent, allowing users to view the investment portfolio, past performance, profit and loss and risk factors of all participating traders. This means that all users can use all necessary information to make smart decisions before copying other investors.',
