          Info: "<p style='color: #000000;font-weight: bold;'>ตลาดโลก</p><p>จากมุมมองของผู้เข้าร่วมในตลาดโลก ตามขนาดของสินทรัพย์ภายใต้การบริหาร ในปี 2018 สถาบันการจัดการสินทรัพย์สี่อันดับแรกและห้าอันดับแรกจากทั้งหมด 6 อันดับแรกพึ่งพาเทคโนโลยีคอมพิวเตอร์ในการตัดสินใจลงทุน และขนาดของเงินทุนที่จัดการโดยการแลกเปลี่ยนเชิงปริมาณและเชิงโปรแกรมได้ขยายตัวขึ้นในปี 2019 ที่หนึ่งคือกองทุน Bridgewater Fund 162.9 พันล้านดอลลาร์สหรัฐ อันดับ 2 AQR 113.8 พันล้านดอลลาร์ อันดับ 3 Renaissance Technology 60.1 พันล้านดอลลาร์ อันดับ 4 Two Sigma 38.8 พันล้านดอลลาร์สหรัฐ อันดับ 5 DE Shaw & Co. 31.2 พันล้านดอลลาร์สหรัฐ</p ><p style='color: #000000;font-weight: bold;'>กล่องดำเพื่อถอดรหัสความมั่งคั่ง</p><p>การซื้อขายอัลกอริทึมเรียกอีกอย่างว่าการซื้อขายอัตโนมัติการซื้อขายกล่องดำหรือเครื่องจักร การซื้อขายหมายถึง การใช้โปรแกรมคอมพิวเตอร์ในการออกคำสั่งการซื้อขาย ในการซื้อขาย ช่วงที่โปรแกรมสามารถกำหนดได้นั้นรวมถึงการเลือกเวลาซื้อขาย ราคาของธุรกรรม และแม้แต่จำนวนหลักทรัพย์ที่ต้องซื้อขายในตอนท้าย</p ><p style='color: #000000;font-weight: bold;'>ผลิตภัณฑ์ของเรา</p><p>ด้วยข้อมูลขนาดใหญ่ เราสามารถเริ่มการเรียนรู้ของหุ่นยนต์และจำลองการเรียนรู้ของเครื่องของสมองมนุษย์ได้</p ><p>Symbol Learning: เลียนแบบกระบวนการเรียนรู้ระดับจิตวิทยามหภาคของสมองมนุษย์ ตามหลักการของจิตวิทยาการรู้คิด โดยใช้ข้อมูลเชิงสัญลักษณ์เป็นอินพุต การดำเนินการเชิงสัญลักษณ์เป็นวิธีการ ใช้เหตุผลเพื่อค้นหาในกราฟหรือพื้นที่ของรัฐ และเป้าหมายการเรียนรู้คือแนวคิดหรือกฎ ฯลฯ วิธีการทั่วไปของการเรียนรู้เชิงสัญลักษณ์ ได้แก่ การเรียนรู้ด้วยความจำ การเรียนรู้ตัวอย่าง การเรียนรู้แบบนิรนัย การเรียนรู้เชิงเปรียบเทียบ การเรียนรู้การตีความ ฯลฯ</p><p>การเรียนรู้โครงข่ายประสาทเทียม (หรือการเรียนรู้การเชื่อมต่อ) : จำลองกระบวนการเรียนรู้ทางจิตวิทยาจุลภาคของสมองมนุษย์ , ตามหลักการของสมองและประสาทวิทยาศาสตร์ , โครงข่ายประสาทเทียมเป็นแบบจำลองโครงสร้างการทำงาน , ข้อมูลตัวเลขที่เป็นอินพุต , การคำนวณเชิงตัวเลขเป็นวิธีการ , กระบวนการวนซ้ำใช้ในการค้นหาใน พื้นที่เวกเตอร์สัมประสิทธิ์และวัตถุประสงค์การเรียนรู้คือฟังก์ชัน โดยทั่วไป การเรียนรู้การเชื่อมต่อ การเรียนรู้การแก้ไขน้ำหนัก การเรียนรู้โทโพโลยี</p><p>เพื่อให้บรรลุการเพิ่มประสิทธิภาพอัตโนมัติของกลยุทธ์การซื้อขายที่สอดคล้องกับสภาวะตลาดในปัจจุบัน ให้หลีกเลี่ยงจุดเสี่ยงโดยอัตโนมัติ และบรรลุสถานะการแข่งขันสูง</p>",
