            "Quantitative致力於幫助並指引我們的員工、客戶及團體共同度過由covid19引發的挑戰和難關。我司願與您分享面對covid19的對策，covid19已在全球引起巨大的市場不穩定性，給商人帶來了前所未有挑戰。我司努力的著重點在於確保我們能持續滿足客戶的不同需求，確保員工安全，最大程度地維持強有力的運轉和科技系統。一直以來，我司以有條不紊的長期投資手段，致力於幫助我們的客戶實現他們的投資目標。作為一家全球性的公司，從2020年3月起我司就致力於應對冠狀病毒，而這一病毒初始被報導於亞洲太平洋。針對此區域，我們的對策包括:重新規劃區域性的貿易中心、限制地區員工出行、提供絕大多數亞洲太平洋地區員工的遠程工作。隨著病毒持續蔓延到世界其他區域，跨功能團隊（美國，亞洲太平洋，emea)對每一地區的管控更加密切。這些團隊的人員，包括了分銷部、資產規劃管理部、貿易部，技術部、管理部、人力資源部、市場部、售後部和其他部門的代表，他們與疾控中心、國際貿易組織，地區健康服務部門協商出了指引規劃，採取了良策來應對高流​​動性市場。我司行動靈敏，確保了遍及全球的員工的可持續健康與安全。最低程度地管控病毒在員工間的蔓延潛在風險，公司的做法如下:1、針對旅行限制，社會分距，遠程會議和工作，提供指引細則。 2、除卻最高管理層人員外，限制國外和國內的商旅出行。3、除卻最高管理層人員外，限制外來人員來訪。4、針對冠狀病毒問題（自我隔離，探親），對員工可額外提供病假日，緊急安全外出日。 5、對各地區實行整體提升的清潔服務。 6、針對封閉協議或潛在員工感染問題，確立條約細則。7、因冠狀病毒影響到工作和科技環境，我們採取了主要措施來確保全球商業的持續運轉。在商業發展、科技規劃及實施方面，最大化地滿足客戶需求。8、隔離、安全管理主要團隊人員和運營，確保可持續滿足客戶和商業需求。9、系統壓力測試、面對潛在的辦公關閉環境，提前準備好居家工作的組織，加強在亞洲地區的工作。我們的系統儲備，給了我們信心，使我司在不確定階段能高效高律地運營。",
