            "基金是通過公開發售基金份額募集資金，由基金託管人託管，由基金管理人管理和運用資金，以資產組合方式進行投資的一種利益共享、風險共擔的集合投資方式。目前Quantitative作為戰略投資者，管理18支基金，資金規模15億美元，以優勢能力和獨特模式，高效地組織項目、資金、服務，幫助個人或者團體獲取良好投資回報。",
          item3: "外匯",
          info3:
            "外匯是貨幣行政當局（中央銀行、貨幣機構、外匯平準基金組織及財政部）以銀行存款、財政部庫券、長短期政府證券等形式所保有的在國際收支逆差時可以使用的債權。外匯市場（Foreign exchange market，簡稱Forex、FX或currency market）是一個分散於全球各地用於交易貨幣的金融市場。除星期六、星期天和交易中心所在國家的重大節日外，世界各地的金融中心按所處位置輪流運轉，使外匯市場能24小時不間斷的買賣各種貨幣。按交易契約種類，有即期、掉期、也有遠期合約等市場存在。外匯市場決定不同貨幣之間的匯率。",
          item4: "期貨",
          info4:
            "期貨合約（英語：Futures contract），簡稱期貨（英語：Futures），是一種跨越時間的交易方式。買賣雙方透過簽訂合約，同意按指定的時間、價格與其他交易條件，交收指定數量的現貨。通常期貨集中在期貨交易所，以標準化合約進行買賣，但亦有部分期貨合約可透過櫃檯交易進行買賣，稱為場外交易合約。期貨是一種金融衍生工具，按現貨標的物之種類，期貨可分為商品期貨與金融期貨兩大類。參與期貨交易者之中，套利者（或稱對沖者）透過買賣期貨，鎖定利潤與成本，減低時間帶來的價格波動風險。投機者則透過期貨交易承擔更多風險，伺機在價格波動中牟取利潤。",
