        etsystem_2:
          "Easy trading(ET system)，為甚麼要創造跟單系統\n為什麼一般的投資人難以參予交易呢？因為交易的過程其實是很複雜的，包含不同的產品選擇、交易策略以及資金比重等等。對於一般投資人來說，交易的介面也是很艱深的，按鍵數據眼花撩亂，讓人很難以上手。\n我們期許提供全球交易投資人更友善及簡單的投資環境，所以創造了「跟單系統」。在跟單系統當中，您可以自由的選擇喜愛的訊號源。訊號源的來源可能是其他的平台投資人，也可以選擇我們平台提供的AI智能投資組合。當選擇好訊號源後，設定交易比例參數後，即可輕鬆達成一鍵交易輕鬆獲利的投資績效。\n\n成為訊號源的好處\n平台利用最新的社群交易功能，建立了一項計畫，在傑出交易者在分享投資知識之餘，還能收到獎勵。線上投資的優點可不只可以訪問不同的交易市場而已。社群功能提供全新的日常交易元素和工具 – 包括賺取收益的新模式。\n\n跟單訊號源計畫具備一項極有吸引力的選擇，就是該計劃獎勵傑出交易者允許他人自動跟單他們的倉位。 如果交易者透過平台的跟單交易系統功能吸引到用戶，就能選擇建立追蹤清單並獲得特殊獎勵。這些特殊獎勵每月累積的金額可能相當可觀。\n\n如何使用跟單系統\n跟單系統是我們的平臺成為金融科技革新領先者的其中一個功能。跟單系統的整體思維非常簡單：選擇您想跟單的訊號源，確定您要投入的金額，只需點擊一個按鈕，就能自動即時跟單訊號源的所有交易活動：\n\n跟單交易規則：\n\n平台的營運完全透明化，讓用戶能查看所有參與交易者的投資組合、以往績效、盈虧及風險係數。這表示所有用戶在跟單其他投資者之前，能使用所有必要資訊，做出睿智的決策。\n",
