            "QuantitativeKomited untuk membantu dan membimbing pekerja kami、Pelanggan dan kumpulan bekerja melalui cabaran dan kesukaran yang disebabkan oleh covid19。Syarikat kami ingin berkongsi dengan anda langkah-langkah pencegahan terhadap covid19，covid19 telah menyebabkan ketidakstabilan pasaran yang besar di seluruh dunia，Membawa cabaran yang tidak pernah berlaku sebelum ini kepada ahli perniagaan。Fokus usaha syarikat kami adalah untuk memastikan kami dapat terus memenuhi keperluan pelanggan yang berbeza, memastikan keselamatan pekerja, dan mengekalkan sistem operasi dan teknologi yang kukuh setakat yang mungkin.。Sejak sekian lama, syarikat kami komited untuk membantu pelanggan kami mencapai matlamat pelaburan mereka dengan kaedah pelaburan berkaedah dan jangka panjang.。Sebagai sebuah syarikat global, syarikat kami telah komited untuk bertindak balas terhadap coronavirus mulai Mac 2020，Dan virus ini pada asalnya dilaporkan di Asia Pasifik。Untuk kawasan ini, langkah balas kami termasuk: perancangan semula pusat perdagangan serantau, menyekat perjalanan pekerja serantau dan menyediakan kerja jauh untuk sebahagian besar pekerja di Asia dan Pasifik.。Memandangkan virus itu terus merebak ke bahagian lain di dunia，Pasukan silang fungsi (AS, Asia Pasifik, emea) mempunyai kawalan yang lebih rapat ke atas setiap rantau。Kakitangan pasukan ini termasuk wakil jabatan pengedaran, jabatan pengurusan perancangan aset, jabatan perdagangan, jabatan teknologi, jabatan pengurusan, jabatan sumber manusia, jabatan pemasaran, jabatan selepas jualan dan jabatan lain，Mereka merundingkan garis panduan dan rancangan dengan CDC, Pertubuhan Perdagangan Antarabangsa, dan jabatan perkhidmatan kesihatan serantau.Strategi yang baik telah diambil untuk menangani pasaran cecair tinggi. Syarikat kami sensitif untuk memastikan kesihatan dan keselamatan pekerja yang mampan di seluruh dunia。Untuk meminimumkan potensi risiko penularan virus di kalangan pekerja, pendekatan syarikat adalah seperti berikut:1、Sediakan garis panduan terperinci untuk sekatan perjalanan, perpisahan sosial, mesyuarat jauh dan kerja。 2、Kecuali kakitangan pengurusan tertinggi, hadkan perjalanan perniagaan asing dan domestik。3、Kecuali kakitangan pengurusan tertinggi, sekatan ke atas lawatan oleh orang luar。4、Sebagai tindak balas kepada isu koronavirus (pengasingan diri, lawatan keluarga), pekerja boleh diberikan hari sakit tambahan dan hari keluar kecemasan yang selamat.。 5、Melaksanakan perkhidmatan pembersihan keseluruhan yang lebih baik untuk setiap kawasan。 6、Wujudkan peraturan perjanjian untuk perjanjian tertutup atau isu jangkitan pekerja yang berpotensi。7、Memandangkan coronavirus menjejaskan persekitaran kerja dan teknologi, kami telah mengambil langkah besar untuk memastikan operasi perniagaan global yang berterusan.Dari segi pembangunan perniagaan, perancangan dan pelaksanaan teknologi, untuk memaksimumkan keperluan pelanggan。8、Asingkan dan uruskan ahli pasukan dan operasi utama dengan selamat untuk memastikan mereka dapat terus memenuhi keperluan pelanggan dan perniagaan。9、Ujian tekanan sistem, menghadapi persekitaran penutupan pejabat yang berpotensi, menyediakan terlebih dahulu organisasi kerja di rumah，Kuatkan kerja di Asia. Rizab sistem kami memberi kami keyakinan dan membolehkan syarikat kami beroperasi dengan cekap dan berdisiplin semasa peringkat yang tidak menentu。",
