      aboutus: {
        etsystem_1: "Sistem dokumentari",
        etsystem_2:
          'Perdagangan mudah (sistem ET), mengapa mencipta sistem dokumentari\nMengapa sukar bagi pelabur biasa untuk mengambil bahagian dalam urus niaga? Kerana proses transaksi sebenarnya sangat rumit, termasuk pilihan produk yang berbeza, strategi perdagangan, perkadaran modal, dan sebagainya. Bagi pelabur biasa, antara muka dagangan juga sangat sukar, dan data utama terpesona, menjadikannya sukar untuk dikuasai。\nKami berharap dapat menyediakan persekitaran pelaburan yang lebih mesra dan mudah untuk pelabur perdagangan global, jadi kami telah mencipta "sistem dokumentari". Dalam sistem dokumentari, anda boleh memilih sumber isyarat kegemaran anda secara bebas. Sumber isyarat mungkin pelabur platform lain, atau anda boleh memilih portfolio pelaburan pintar AI yang disediakan oleh platform kami. Selepas memilih sumber isyarat dan menetapkan parameter nisbah transaksi, anda boleh dengan mudah mencapai prestasi pelaburan perdagangan satu klik dan keuntungan mudah。\n\nFaedah menjadi sumber isyarat\nPlatform ini menggunakan ciri dagangan komuniti terkini untuk mewujudkan pelan, di mana pedagang yang cemerlang boleh menerima ganjaran sambil berkongsi pengetahuan pelaburan mereka. Kelebihan pelaburan dalam talian bukan hanya untuk mengakses pasaran dagangan yang berbeza. Fungsi komuniti menyediakan elemen dan alatan dagangan harian baharu-termasuk model baharu untuk memperoleh hasil。\n\nPilihan yang sangat menarik untuk program Sumber Isyarat Salin ialah program ini memberi ganjaran kepada pedagang yang cemerlang kerana membenarkan orang lain menyalin kedudukan mereka secara automatik. Jika peniaga menarik pengguna melalui fungsi sistem perdagangan salinan platform, mereka boleh memilih untuk membuat senarai penjejakan dan menerima ganjaran istimewa. Jumlah terkumpul ganjaran istimewa ini setiap bulan mungkin besar。\n\nCara menggunakan sistem dokumentari\nSistem dokumentari adalah salah satu fungsi platform kami untuk menjadi peneraju dalam inovasi teknologi kewangan. Pemikiran keseluruhan sistem penyalinan dokumen adalah sangat mudah: pilih sumber isyarat yang anda ingin salin, tentukan jumlah yang anda ingin laburkan, dan hanya klik butang untuk menyalin secara automatik semua aktiviti perdagangan sumber isyarat dalam masa nyata：\n\nSalin peraturan perdagangan：\n\nPengendalian platform adalah telus sepenuhnya, membolehkan pengguna melihat portfolio pelaburan, prestasi lepas, untung rugi dan faktor risiko semua pedagang yang mengambil bahagian. Ini bermakna semua pengguna boleh menggunakan semua maklumat yang diperlukan untuk membuat keputusan bijak sebelum meniru pelabur lain。\n',
        aboutus_1: "Tentang kami",
        aboutus_2:
          "Syarikat pengurusan pelaburan alternatif terkemuka di Asia. Ditubuhkan pada 2008, Quantitative ialah syarikat pengurusan pelaburan alternatif yang terkemuka di Asia. Kami berakar umbi dalam Asia yang sedang berkembang pesat, dengan wawasan, pengetahuan dan kepakaran yang paling meluas di Asia. Quantitative mempunyai pasukan pengurusan berpengalaman yang telah melabur di Asia sejak pertengahan 1990-an. Pasukan ini mempunyai budaya kerjasama yang kukuh yang menjadikan kami menonjol daripada rakan sejawat global kami. Matlamat utama kami adalah untuk mencapai pulangan terlaras risiko yang sangat baik untuk pelanggan kami. Dana kami diuruskan oleh sekumpulan PM profesional yang berbeza, termasuk strategi daripada pengurusan aktif tanpa kekangan kepada kaedah kuantitatif yang sistematik. ",
        aboutus_3:
          "Syarikat pengurusan pelaburan alternatif terkemuka di Asia. Ditubuhkan pada 2008, Quantitative ialah syarikat pengurusan pelaburan alternatif yang terkemuka di Asia. Kami berakar umbi dalam Asia yang sedang berkembang pesat, dengan wawasan, pengetahuan dan kepakaran yang paling meluas di Asia. Quantitative mempunyai pasukan pengurusan berpengalaman yang telah melabur di Asia sejak pertengahan 1990-an. Pasukan ini mempunyai budaya kerjasama yang kukuh yang menjadikan kami menonjol daripada rakan sejawat global kami. Matlamat utama kami adalah untuk mencapai pulangan terlaras risiko yang sangat baik untuk pelanggan kami. Dana kami diuruskan oleh sekumpulan PM profesional yang berbeza, termasuk strategi daripada pengurusan aktif tanpa kekangan kepada kaedah kuantitatif yang sistematik. ",
        aboutus_9: "Kemungkinan risiko dan penafian",
        aboutus_10:
          "<br/>1. Pelaburan adalah berisiko, jadi pilih dengan teliti.\n<br/>2. Urus niaga pertukaran asing dan urus niaga logam berharga spot melibatkan risiko kerugian yang ketara dan tidak sesuai untuk semua pelabur.\n<br/>3. Maklumat yang diberikan oleh pengguna semasa pendaftaran mestilah benar dan sah, jika tidak Quantitative berhak untuk menolak untuk memberikan perkhidmatan kepada anda.\n<br/>4. Sebelum membuka akaun dagangan, sila pertimbangkan dengan teliti tahap pengalaman anda, objektif pelaburan, aset, pendapatan dan toleransi risiko.\n<br/>5. Dagangan boleh mengakibatkan kerugian sebahagian atau keseluruhan pelaburan anda, jadi anda tidak boleh menggunakan dana yang anda pinjam atau perlu gunakan segera atau anda tidak mampu kerugian, yang diperlukan untuk kelangsungan hidup peribadi atau keluarga anda, untuk spekulasi, pelaburan atau transaksi lindung nilai.\n<br/>6. Quantitative ialah penyedia perkhidmatan teknikal dan tidak mengesyorkan mana-mana platform dagangan lain, dan tidak bertanggungjawab ke atas kerugian yang disebabkan oleh kegagalan komunikasi, salah nyata atau kelewatan dalam transaksi.\n<br/>7. Quantitative akan mengenakan 15% daripada keuntungan harian sebagai yuran perkhidmatan transaksi kuantitatif.\n<br/>8. Quantitative berhak untuk mentafsir perkara yang tidak dinyatakan dalam syarat perjanjian ini. ",
      },
