            "Quantitativeは、covid19によって引き起こされる課題と困難を乗り越えて、従業員、顧客、グループを支援し、導くことに尽力しています。私たちの会社はあなたとcovid19に対する対策を共有したいと思います。Covid19は世界中で巨大な市場の不安定さを引き起こし、ビジネスマンに前例のない挑戦をもたらしました。当社の取り組みの焦点は、お客様のさまざまなニーズに応え続け、従業員の安全を確保し、強力な運用と技術システムを最大限に維持できるようにすることです。当社は長年にわたり、お客様が整然とした長期投資方法で投資目標を達成できるよう支援することをお約束してきました。当社はグローバル企業として、2020年3月からコロナウイルスへの対応に取り組んでおり、当初はアジア太平洋地域で報告されていました。この分野への対応として、地域貿易センターの再計画、地域従業員の移動の制限、アジア太平洋地域の大多数の従業員へのリモートワークの提供などの対策があります。ウイルスが世界の他の地域に広がり続けるにつれて、部門の枠を超えたチーム（米国、アジア太平洋、EMEA）が各地域をより厳密に管理します。これらのチームの担当者には、流通部門、資産計画管理部門、貿易部門、技術部門、管理部門、人材部門、マーケティング部門、アフターセールス部門などの代表者が含まれ、CDC、国際貿易機関と協力しています。 、および地域保健サービス部門は、ガイドラインと計画を交渉し、高流動性市場に対処するための優れた戦略を採用しました。私たちの機敏な行動は、世界中の従業員の持続可能な健康と安全を保証します。従業員間でのウイルスの拡散の潜在的なリスクを最小限に抑えるために、会社のアプローチは次のとおりです。1。渡航禁止、社会的分離、遠隔会議および仕事に関するガイドラインとルールを提供します。 2.経営トップを除き、国内外の出張を制限します。 3.経営トップに加えて、部外者の訪問も制限されています。 4.コロナウイルスの問題（自己隔離、親戚の訪問）に対応して、従業員には追加の病欠と緊急および安全な外出日を提供することができます。 5.すべての地域で全体的に改善された清掃サービスを実施します。 6.クローズドアグリーメントまたは潜在的な従業員感染問題に関する条約規則を確立します。 7.コロナウイルスは作業環境や技術環境に影響を与えるため、グローバルビジネスの継続的な運営を確保するために大きな対策を講じています。事業開発、技術計画、実施の観点から、お客様のニーズを最大化します。 8.主要なチームメンバーと運用を分離して安全に管理し、顧客とビジネスのニーズを継続的に満たすことができるようにします。 9.潜在的なオフィス閉鎖環境に直面したシステムストレステストは、事前に自宅での作業の組織を準備し、アジア地域での作業を強化します。私たちのシステムリザーブは私たちに自信を与え、不確実な段階で私たちの会社が効率的かつ規律正しく運営することを可能にします。 ",
